B.a52=new A.O(B.iP,["Creative Buds","Creative Buds is a highly engaging educational app designed to teach young children essential writing and reading skills in a playful and interactive way. The app focuses on guiding children through the learning process by using finger movement recognition, where kids can practice tracing letters and words directly on the screen.\n\nThe app\u2019s user-friendly design offers real-time feedback, encouraging children as they learn to write and read. Creative Buds features a variety of educational modules, developed in collaboration with experts, that are age-appropriate and designed to enhance the learning curve in a natural, engaging way.\n\nIn addition to its core writing and reading features, Creative Buds includes in-app purchases for premium content, securely processed through Stripe, making it easy for parents to unlock additional learning materials as their child progresses.\n\nWith its innovative approach to education, Creative Buds is an invaluable tool for children beginning their reading and writing journey.",B.b4,"assets/videos/creative.mp4",B.bt],t.M)
